import "./widgetBlock6.css";

export const WidgetBlock6 = () => {
  return (
    <div className="widgetContainer6">
      <img src="\img\Group 2740 (1).svg" alt="img" className="widgetImg6" />
      <span className="widgetTitle6">Konektovanih korisnika</span>
      <span className="widgetNum6">98</span>
      <span className="widgetStat6">+5 ove sedmice</span>
    </div>
  );
};
